<script lang="ts" setup>
import { ref } from "vue";
import useSidebarStore from "@/stores/sidebarStore";
import { useI18n } from "vue-i18n";
import html2canvas from "html2canvas";
import LanguageSwitcher from "./LanguageSwitcher.vue";

const sidebarStore = useSidebarStore();
const { t } = useI18n();

// Urban resilience indicators
const urbanResilienceIndicators = [
  { name: "echarts.capacities.Robustness", isHighlighted: true },
  { name: "echarts.capacities.Redundancy", isHighlighted: false },
  { name: "echarts.capacities.Diversity", isHighlighted: false },
  { name: "echarts.capacities.Flexiblity", isHighlighted: true },
  { name: "echarts.capacities.Integration", isHighlighted: false },
  { name: "echarts.capacities.Inclusiveness", isHighlighted: false },
  { name: "echarts.capacities.Reflectiveness", isHighlighted: false },
  { name: "echarts.capacities.Resourcefulness", isHighlighted: true },
  { name: "echarts.capacities.Transparency", isHighlighted: false },
];

// References for modal content and iframes
const modalContent = ref<HTMLElement | null>(null);
// Downlaod event
const downloadFirstDashboard = () => {
  if (!modalContent.value) {
    console.error("Modal content not found!");
    return;
  }

  html2canvas(modalContent.value, { scale: 2 }).then((canvas) => {
    const imgData = canvas.toDataURL("image/png");
    const link = document.createElement("a");
    link.href = imgData;
    link.download =
      t("sidebar.settingsPanel.step3.tableHeaders.diagnoseDashboard") + ".png";
    link.click();
  });
};
</script>
<template>
  <button class="btn btn-primary" data-bs-target="#first-analysis" data-bs-toggle="modal">
    {{ $t("sidebar.analysisDashboard.open") }}
  </button>
  <div id="first-analysis" class="modal fade" ref="modalContent">
    <div class="modal-dialog modal-fullscreen">
      <div class="modal-content">
        <div class="modal-header p-2">
          <h5 class="modal-title">
            {{ $t("sidebar.analysisDashboard.challenge") }}
            {{ sidebarStore.selectedTopic }}
          </h5>
          <language-switcher class="ms-4"></language-switcher>
          <button type="button" class="btn-close" data-bs-dismiss="modal"></button>
        </div>
        <div class="modal-body p-1 overflow-hidden">
          <div class="container-fluid h-100">
            <div class="row h-100">
              <!-- Left Column -->
              <div class="col-md-4 d-flex flex-column">
                <div id="disruption-types" class="flex-grow-2 overflow-hidden mb-3">
                  <p class="mb-3">
                    <strong>{{
                      $t("sidebar.analysisDashboard.disruption_types")
                    }}</strong>
                    {{ $t("sidebar.analysisDashboard.water_supply_chain") }}
                  </p>
                  <!-- water source graph -->
                  <img
                    src="data:image/png;base64,"
                    style="cursor: pointer; max-width: 100%"
                    onclick="(function(img){if(img.wnd!=null&&!img.wnd.closed){img.wnd.focus();}else{var r=function(evt){if(evt.data=='ready'&&evt.source==img.wnd){img.wnd.postMessage(decodeURIComponent(img.getAttribute('src')),'*');window.removeEventListener('message',r);}};window.addEventListener('message',r);img.wnd=window.open('https://viewer.diagrams.net/?client=1&page=0&edit=_blank');}})(this);"
                  />
                </div>
                <div id="affected-indicators" class="flex-grow-1 overflow-auto">
                  <p class="fw-bold">
                    {{
                      $t("sidebar.analysisDashboard.affected_urban_resilience_capacities")
                    }}
                  </p>
                  <ul class="list-group w-75">
                    <li
                      v-for="(indicator, index) in urbanResilienceIndicators"
                      :key="index"
                      :class="[
                        'list-group-item',
                        indicator.isHighlighted ? 'list-group-item-success' : '',
                      ]"
                    >
                      {{ indicator.isHighlighted ? "+ " : "" }}{{ $t(indicator.name) }}
                    </li>
                  </ul>
                </div>
              </div>
              <!-- Right Column -->
              <div class="col-md-8 d-flex flex-column">
                <div id="navigate-map" class="mb-3">
                  <p class="fw-bold">
                    {{ $t("sidebar.analysisDashboard.navigate_to_the_map") }}
                  </p>
                  <button class="btn btn-primary mb-2">
                    {{ $t("sidebar.analysisDashboard.go_to_layer_set") }}
                  </button>
                </div>
                <div id="affected-diagram" class="flex-grow-1">
                  <p class="mb-3 fw-bold">
                    {{ $t("sidebar.analysisDashboard.other_components") }}
                  </p>
                  <!-- other affected components graph -->
                  <img
                    src="data:image/png;base64,"
                    style="cursor: pointer; max-width: 100%"
                    onclick="(function(img){if(img.wnd!=null&&!img.wnd.closed){img.wnd.focus();}else{var r=function(evt){if(evt.data=='ready'&&evt.source==img.wnd){img.wnd.postMessage(decodeURIComponent(img.getAttribute('src')),'*');window.removeEventListener('message',r);}};window.addEventListener('message',r);img.wnd=window.open('https://viewer.diagrams.net/?client=1&page=0&edit=_blank');}})(this);"
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
        <div class="modal-footer">
          <button
            type="button"
            class="btn btn-sm btn-success"
            @click="downloadFirstDashboard"
          >
            <i class="bi bi-download"></i> {{ $t("sidebar.analysisDashboard.download") }}
          </button>
        </div>
      </div>
    </div>
  </div>
</template>

<style scoped>
.flex-grow-2 {
  flex-grow: 2;
}
.flex-grow-1 {
  flex-grow: 1;
}
</style>
